import React, { useState } from "react";
import "../assets/css/Auth/header.css";
import logo from "../assets/img/logo.png";
function Header() {
  const [mainue, setMainue] = useState(
    <img
      style={{ width: "25px", height: "25px" }}
      src={
        "data:image/jpeg;base64,"
      }
      alt="close mainue"
    />
  );
  const [mainueState, setMainueState] = useState("block");
  const toggleMainue = () => {
    if (mainueState === "block") {
      setMainue(
        <img
          style={{ width: "30px", height: "30px" }}
          src={
            "data:image/jpeg;base64,"
          }
          alt="open mainue"
        />
      );
      setMainueState("none");
    } else {
      setMainue(
        <img
          style={{ width: "25px", height: "25px" }}
          src={
            "data:image/jpeg;base64,"
          }
          alt="close mainue"
        />
      );
      setMainueState("block");
    }
  };
  return (
    <>
      <header id="header">
        <img id="logo" src={logo} alt="App logo" />
        <div>
          <button onClick={toggleMainue} id="close_link">
            {mainue}
          </button>
          <div style={{ display: mainueState }}>
            <ul id="link">
              <li key={"home"}>
                <a className="applinks" href="#header">
                  Home
                </a>
              </li>
              <li key={"art"}>
                <a className="applinks" href="#art_demo">
                  Exhibits
                </a>
              </li>
              <li key={"contact"}>
                <a
                  className="applinks"
                  href="#contact"
                  style={{
                    background: "darkcyan",
                    color: "white",
                    borderRadius: "0.3rem",
                  }}
                >
                  Contact
                </a>
              </li>
            </ul>
          </div>
        </div>
      </header>
    </>
  );
}

export default Header;
